import errorimg from "../imgs/error.gif"
import styles from "./Error.module.css"

function Error(){
    return(
        <div className={styles.notFoundContainer}>
            <img src={errorimg}></img>
            <h1>Not pokemons found</h1>
        </div>
    )
}

export default Error;
